      !isEmpty(auth.user.organisation_id)) ||
    (auth.isAuthenticated && rest.path === "/admin") ? (
      <Component {...rest} />
    ) : auth.isAuthenticated && !isEmpty(auth.user) ? (
      <Redirect to="/admin" />
    ) : (
      <Redirect to="/" />
    );
  return <Route {...rest} render={(props) => route} />;
};

